قال الله تعالى: {يا أيها الذين آمنوا أوفوا بالعقود}
قال ابن عباس رضي الله عنهماوغيره: يعني العهود.
وقال زيد بن أسلم: أوفوا بالعقود هي ستة: عهد الله، وعقد الحلف، وعقد الشركة، وعقد البيع، وعقد النكاح، وعقد اليمين.
